package Activity1;

public class Question29 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//29.	Write a program to print the first 10 natural numbers using a while loop.
		
		int count = 1;
		while(count <= 10);
				System.out.println( count + " ");
				count ++;
	}
}
	
